    # filter out subsequences with duplicates
    unique_subsequences = set()
    for subseq in subsequences:
        if subseq not in unique_subsequences:
            unique_subsequences.add(subseq)

    # if the number of unique subsequences is less than k, it's impossible to obtain S
    if len(unique_subsequences) < k:
        return -1

