    n = int(stdin.split('\n')[0])
    sequence = list(map(int, stdin.split('\n')[1].split()))

    def multiply(x):
        return x * 2

    def divide(x):
        return x // 3

    def process(x, n):
        result = x
        for _ in range(n - 1):
            if result % 3 == 0:
                result = divide(result)
            else:
                result = multiply(result)
        return result

    def find_previous_number(x, sequence):
        for i, num in enumerate(sequence):
            if num % 2 == 0:
                continue
            else:
                if (num - x) % 2 == 0:
                    return i
        return -1

    def find_index(x, sequence):
        for i, num in enumerate(sequence):
            if num == x:
                return i
        return -1

    def reorder_sequence(sequence):
        for i in range(n):
            x = sequence[i]
            if x % 3 == 0:
                x = divide(x)
            else:
                x = multiply(x)
            index = find_previous_number(x, sequence[:i])
            if index != -1:
                sequence[index], sequence[i] = sequence[i], sequence[index]
        return sequence

    result = reorder_sequence(sequence)
    result = [str(process(int(num), n)) for num in result]

    return '\n'.join(result)

