        visited[node] = True
        for neighbor in graph[node]:
            if not visited[neighbor]:
                stack.append((node, neighbor))
                dfs(graph, neighbor, visited, stack)

    def diameter(graph):
        visited = [False] * (n + 1)
        stack = []
        dfs(graph, 1, visited, stack)
