    for i, line in enumerate(stdin.split("\n")[:-1]):
        for j, value in enumerate(map(int, line.split())):
            grid[i][j] = value

    def merge_and_move(line: list) -> list:
        merged = []
        for value in line:
            if value == 0:
                merged.append(0)
            else:
                while merged and merged[-1] == 0:
                    merged.pop()
                if merged and merged[-1] == value:
                    merged[-1] *= 2
                else:
                    merged.append(value)
        while merged and merged[-1] == 0:
            merged.pop()
        return merged

    def move_and_merge(grid: list, direction: int) -> list:
        if direction == 0:
            return [merge_and_move(row) for row in grid]
        elif direction == 1:
            return [merge_and_move([row[i] for row in grid]) for i in range(4)]
        elif direction == 2:
            return [merge_and_move(row[::-1])[::-1] for row in grid]
        else:
            return [merge_and_move([row[i] for row in grid[::-1]][::-1])[::-1] for i in range(4)]

    new_grid = move_and_merge(grid, direction)

    for i in range(4):
        for j in range(4):
            print(new_grid[i][j], end=" ")
        print()

    return "\n".join(str(row) for row in new_grid)

