    desired_area = int(input_list[num_corners + 1])

    def area(points):
        return 0.5 * abs(sum(points[i][0] * points[(i + 1) % len(points)][1] - points[(i + 1) % len(points)][0] * points[i][1] for i in range(len(points))))

    def perimeter(points):
        return sum(sqrt((points[i][0] - points[(i + 1) % len(points)][0]) ** 2 + (points[i][1] - points[(i + 1) % len(points)][1]) ** 2) for i in range(len(points)))

    def rescale(points, factor):
        return [(x * factor, y * factor) for x, y in points]

    original_area = area(original_points)
    original_perimeter = perimeter(original_points)

    desired_perimeter = sqrt(desired_area)
    scale_factor = desired_perimeter / original_perimeter

    rescaled_points = rescale(original_points, scale_factor)
    rescaled_area = area(rescaled_points)

    while abs(rescaled_area - desired_area) > 1e-6:
        adjustment = (rescaled_area - desired_area) / original_area
        rescaled_points = rescale(rescaled_points, 1 + adjustment)
        rescaled_area = area(rescaled_points)

    if rescaled_points[0][0] < 0 or rescaled_points[0][1] < 0:
        rescaled_points = [(x + 2 * abs(min(x, 0)), y + 2 * abs(min(y, 0))) for x, y in rescaled_points]

    output = '\n'.join(f'{x:.4f} {y:.4f}' for x, y in rescaled_points)
