            if (name1, lang) in characters and (name2, lang) in characters:
                if find_conversation(name1, name2):
                    return True
        return False

    def can_converse(name1, name2):
        return find_conversation(name1, name2) or find_conversation(name2, name1)

    def find_smallest_set():
        min_size = n
        for i in range(n):
            for j in range(i + 1, n):
                if can_converse(characters[i][0], characters[j][0]):
                    min_size = min(min_size, i + j + 1)
        return min_size

    return find_smallest_set()

